function About() {
  return (
    <div>
      <h4 className="m-3">About</h4>
      <p className="m-3">
        CivicEngine is a Peer-2-Peer Campus Voter Canvassing tool. It allows
        students to find information how to take civic actions and participate
        in elections at all levels of the ballot.
      </p>
    </div>
  );
}

export default About;
